import React from 'react';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import { Text, View, StyleSheet } from 'react-native';

import DashboardScreen from '../screens/DashboardScreen';
import IrrigationScreen from '../screens/IrrigationScreen';
import AlertsScreen from '../screens/AlertsScreen';
import AssistantScreen from '../screens/AssistantScreen';
import CropDetailsScreen from '../screens/CropDetailsScreen';
import IrrigationRecommendationScreen from '../screens/IrrigationRecommendationScreen';
import DiseaseDetailsScreen from '../screens/DiseaseDetailsScreen';
import HealthHomeScreen from '../screens/HealthHomeScreen';
import CropHealthDetailScreen from '../screens/CropHealthDetailScreen';
import DiseaseScanScreen from '../screens/DiseaseScanScreen';
import DiseaseResultScreen from '../screens/DiseaseResultScreen';
import GovernmentSchemesScreen from '../screens/GovernmentSchemesScreen';
import SchemeDetailScreen from '../screens/SchemeDetailScreen';
import MarketPricesScreen from '../screens/MarketPricesScreen';

import { RootStackParamList, TabParamList } from '../types';

const Tab = createBottomTabNavigator<TabParamList>();
const Stack = createNativeStackNavigator<RootStackParamList>();

const TabIcon: React.FC<{ icon: string; label: string; focused: boolean }> = ({
  icon,
  label,
  focused,
}) => (
  <View style={styles.tabIconContainer}>
    <Text style={[styles.tabIcon, focused && styles.tabIconFocused]}>{icon}</Text>
    <Text style={[styles.tabLabel, focused && styles.tabLabelFocused]}>{label}</Text>
  </View>
);

const TabNavigator: React.FC = () => {
  return (
    <Tab.Navigator
      screenOptions={{
        headerShown: false,
        tabBarStyle: styles.tabBar,
        tabBarShowLabel: false,
      }}
    >
      <Tab.Screen
        name="Dashboard"
        component={DashboardScreen}
        options={{
          tabBarIcon: ({ focused }) => (
            <TabIcon icon="üè†" label="‡§°‡•à‡§∂‡§¨‡•ã‡§∞‡•ç‡§°" focused={focused} />
          ),
        }}
      />
      <Tab.Screen
        name="Irrigation"
        component={IrrigationScreen}
        options={{
          tabBarIcon: ({ focused }) => (
            <TabIcon icon="üíß" label="‡§∏‡§ø‡§Ç‡§ö‡§æ‡§à" focused={focused} />
          ),
        }}
      />
      <Tab.Screen
        name="Health"
        component={HealthHomeScreen}
        options={{
          tabBarIcon: ({ focused }) => (
            <TabIcon icon="üè•" label="‡§∏‡•ç‡§µ‡§æ‡§∏‡•ç‡§•‡•ç‡§Ø" focused={focused} />
          ),
        }}
      />
      <Tab.Screen
        name="Alerts"
        component={AlertsScreen}
        options={{
          tabBarIcon: ({ focused }) => (
            <TabIcon icon="üîî" label="‡§Ö‡§≤‡§∞‡•ç‡§ü" focused={focused} />
          ),
        }}
      />
      <Tab.Screen
        name="Assistant"
        component={AssistantScreen}
        options={{
          tabBarIcon: ({ focused }) => (
            <TabIcon icon="ü§ñ" label="‡§∏‡§π‡§æ‡§Ø‡§ï" focused={focused} />
          ),
        }}
      />
    </Tab.Navigator>
  );
};

const AppNavigator: React.FC = () => {
  return (
    <Stack.Navigator
      screenOptions={{
        headerShown: false,
      }}
    >
      <Stack.Screen name="MainTabs" component={TabNavigator} />
      <Stack.Screen
        name="CropDetails"
        component={CropDetailsScreen}
        options={{
          headerShown: true,
          headerTitle: '‡§´‡§∏‡§≤ ‡§µ‡§ø‡§µ‡§∞‡§£',
          headerTintColor: '#FFFFFF',
          headerStyle: { backgroundColor: '#2E7D32' },
        }}
      />
      <Stack.Screen
        name="IrrigationRecommendation"
        component={IrrigationRecommendationScreen}
        options={{
          headerShown: true,
          headerTitle: '‡§∏‡§ø‡§Ç‡§ö‡§æ‡§à ‡§∏‡§≤‡§æ‡§π',
          headerTintColor: '#FFFFFF',
          headerStyle: { backgroundColor: '#1976D2' },
        }}
      />
      <Stack.Screen
        name="DiseaseDetails"
        component={DiseaseDetailsScreen}
        options={{
          headerShown: true,
          headerTitle: '‡§∞‡•ã‡§ó ‡§µ‡§ø‡§µ‡§∞‡§£',
          headerTintColor: '#FFFFFF',
          headerStyle: { backgroundColor: '#FF9800' },
        }}
      />
      <Stack.Screen
        name="CropHealthDetail"
        component={CropHealthDetailScreen}
        options={{
          headerShown: true,
          headerTitle: '‡§´‡§∏‡§≤ ‡§∏‡•ç‡§µ‡§æ‡§∏‡•ç‡§•‡•ç‡§Ø ‡§µ‡§ø‡§µ‡§∞‡§£',
          headerTintColor: '#FFFFFF',
          headerStyle: { backgroundColor: '#2E7D32' },
        }}
      />
      <Stack.Screen
        name="DiseaseScan"
        component={DiseaseScanScreen}
        options={{
          headerShown: true,
          headerTitle: '‡§∞‡•ã‡§ó ‡§∏‡•ç‡§ï‡•à‡§®',
          headerTintColor: '#FFFFFF',
          headerStyle: { backgroundColor: '#2E7D32' },
        }}
      />
      <Stack.Screen
        name="DiseaseResult"
        component={DiseaseResultScreen}
        options={{
          headerShown: true,
          headerTitle: '‡§®‡§ø‡§¶‡§æ‡§® ‡§™‡§∞‡§ø‡§£‡§æ‡§Æ',
          headerTintColor: '#FFFFFF',
          headerStyle: { backgroundColor: '#FF9800' },
        }}
      />
      <Stack.Screen
        name="GovernmentSchemes"
        component={GovernmentSchemesScreen}
        options={{
          headerShown: true,
          headerTitle: '‡§∏‡§∞‡§ï‡§æ‡§∞‡•Ä ‡§Ø‡•ã‡§ú‡§®‡§æ‡§è‡§Ç',
          headerTintColor: '#FFFFFF',
          headerStyle: { backgroundColor: '#1565C0' },
        }}
      />
      <Stack.Screen
        name="SchemeDetail"
        component={SchemeDetailScreen}
        options={{
          headerShown: true,
          headerTitle: '‡§Ø‡•ã‡§ú‡§®‡§æ ‡§µ‡§ø‡§µ‡§∞‡§£',
          headerTintColor: '#FFFFFF',
          headerStyle: { backgroundColor: '#1565C0' },
        }}
      />
      <Stack.Screen
        name="MarketPrices"
        component={MarketPricesScreen}
        options={{
          headerShown: true,
          headerTitle: '‡§Æ‡§Ç‡§°‡•Ä ‡§≠‡§æ‡§µ',
          headerTintColor: '#FFFFFF',
          headerStyle: { backgroundColor: '#E65100' },
        }}
      />
    </Stack.Navigator>
  );
};

const styles = StyleSheet.create({
  tabBar: {
    position: 'absolute',
    bottom: 0,
    left: 0,
    right: 0,
    height: 70,
    backgroundColor: '#FFFFFF',
    borderTopWidth: 1,
    borderTopColor: '#E0E0E0',
    paddingTop: 8,
    paddingBottom: 8,
    elevation: 10,
    shadowColor: '#000',
    shadowOffset: { width: 0, height: -4 },
    shadowOpacity: 0.1,
    shadowRadius: 8,
  },
  tabIconContainer: {
    alignItems: 'center',
    justifyContent: 'center',
  },
  tabIcon: {
    fontSize: 24,
    marginBottom: 4,
  },
  tabIconFocused: {
    fontSize: 28,
  },
  tabLabel: {
    fontSize: 11,
    color: '#757575',
    fontWeight: '500',
  },
  tabLabelFocused: {
    color: '#2E7D32',
    fontWeight: 'bold',
  },
});

export default AppNavigator;
